//Import components
import LinkButton from '../components/layout/linkButton'

function Home() {
    return (
        <div className='home'>
            <h1>MoreLife</h1>
            <div className='flexBtns'>
                <LinkButton to="/login" type="login" text="Login" />
                <LinkButton to="/register" type="register" text="Register" />
            </div>
        </div>
    )
}

export default Home
